// @flow 
import * as React from 'react';
import './NavBar.scss';
import '../CartIcon/CartIcon';
import { CartIcon } from '../CartIcon/CartIcon';

export const NavBar = ({ click, children}) => {
    return (
        <div className='navBar'>
        <div className="navBar_list">
            <ul className='navBar_list'>
                <li className='navBar_list_item' onClick = {click}>Zapatos</li>
                <li className='navBar_list_item'>Carteras y accesorios</li>
                <li className='navBar_list_item'>Nosotres</li>
                <li className='navBar_list_item'>Locales</li>
                <li className="navBar_list_item">Outlet</li>
            </ul>
        </div>
        <CartIcon/>
      </div>
    );
};
